import React from 'react';
import { Link } from 'react-router-dom';

import './navbar.css';

function Navbar() {
    return (
        <div id='navbar'>
            <img src='/images/stardust_nav_logo.png' />
            <ul id='nav-menu'>
                <li className='nav-item'>
                    <Link to='/testsite'>Home</Link>
                </li>
                <li className='nav-item'>
                    <Link to='/testsite/activities'>Activities</Link>
                </li>
            </ul>
        </div>
    )
}

export default Navbar;
